import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class Me extends React.Component {
    render () {
        return (
            <div>
                'What's up'
            </div>
        )
    }
}

ReactDOM.render(<Me />, document.getElementById('root'));
